import { Injectable } from '@angular/core';
import { MOVIES } from '../mock-movies'
import { Movie } from '../Movie';

@Injectable({
  providedIn: 'root'
})
export class MovieService {
  movies: Movie[] = MOVIES;

  constructor() { }

  getMovies(): Movie[] {
    return MOVIES;
  }

}
